function createCard(contact) {
  return (
    <Card
      key={contact.id}
      name={contact.name}
      img={contact.imgURL}
      heading={contact.heading}
    />
  );
}

function App() {
  return (
    <div>
      <Header />
      {contacts.map(createCard)}
      <Footer />
    </div>
  );
}



export default App;
